import { Injectable } from '@angular/core';
import { Prodavnica } from 'src/app/Klase/Markets';

@Injectable({
  providedIn: 'root'
})
export class MarketService {

  public prodavnice:Array<Prodavnica>=new Array<Prodavnica>(
    new Prodavnica(
      "Lidl supermarket",
      "Lokacija 1",
      "data:image/png;base64,"
    ),
    new Prodavnica(
      "Lidl market",
      "Lokacija 1",
      "data:image/png;base64,"
    ),
    new Prodavnica(
      "Lidl minimarket",
      "Lokacija 1",
      "data:image/png;base64,"
    ),
    new Prodavnica(
      "Dis market",
      "Lokacija4",
      "data:image/jpeg;base64,"
  ));
  constructor() { }
  public potrazi(tekst:any){
    this.prodavnice.forEach(prodavnica=>{
      if(!this.selection1.includes(prodavnica)&&!this.selection.includes(prodavnica)){
        this.selection.push(prodavnica);
      }
    });
    if(tekst==="")
    this.prodavnice.forEach(prodavnica=>{
      if(!this.selection1.includes(prodavnica)&&!this.selection.includes(prodavnica)){
        this.selection.push(prodavnica);
      }
    });
    else{
    this.selection=this.selection.filter(prodavnica=>prodavnica.naziv.includes(tekst));
    }
  }
  selection=this.prodavnice;
  selection1:Array<Prodavnica>=new Array<Prodavnica>();
  public ubaciUSelection1(parametar:Prodavnica){
    this.selection1.push(this.selection.filter(prodavnica=>prodavnica.naziv===parametar.naziv)[0]);
    this.selection=this.selection.filter(prodavnica=>prodavnica.naziv!==parametar.naziv);
    console.log(this.selection);
    console.log(this.selection1);
  }
  public izbaciIzSelection1(parametar:Prodavnica){
    this.selection.push(parametar);
    this.selection1=this.selection1.filter(prodavnica=>prodavnica.naziv!==parametar.naziv);
  }
}
